using namespace std;

/***
 The "Split()" function splits up the elements of the input into two output vectors divided at the middle
 these output vectors being of course "Output_One" and "Output_Two".
 ***/
void Split(const vector<int>& input, vector<int> *Output_One, vector<int> *Output_Two){
	int i=0;
	//If it is an empty list then we can just return and not do anything.
	if(input.size()==0){return;}
	
	//If the length of our input is not even we enter this statement.
	if(input.size()%2!=0){
		//Output One gets the elements from the first half of the input.
		for(int i=0; i<=input.size()/2;i++){	Output_One->push_back(input.at(i));		}
		
		//Output Two gets the elements from the second half ( +1) of the input.
		for(int i=input.size()/2+1; i<input.size();i++){	Output_Two->push_back(input.at(i));		}
	}

	//If we have even input then we enter this statement instead.
	else if(input.size()%2==0){
		//First half of the input goes to the vector "Output_One"
		for(int i=0; i<input.size()/2;i++){		Output_One->push_back(input.at(i));		}
		//Second half of the input goes to the vector "Output_Two"	
		for(int i=input.size()/2; i<input.size();i++){		Output_Two->push_back(input.at(i));		}
	}
}

/***
 The "Merge()" function merges two input vectors and then updates the passed reference to "Output", while 
 it does this it makes sure that the vector is kept sorted.
 ***/
void Merge(const vector<int>& input1, const vector<int>& input2, vector<int>* Output){
	vector<int> New_Input_One(input1);
	vector<int> New_Input_Two(input2);

	//If if both of the inputs are not empty. 
	while(New_Input_One.size()!=0 && New_Input_Two.size()!=0){
		
		//If the First element of Input_One is less than the First element of Input_Two, we push the front element 
		//	of Input_One to the back of the output, and then erase that element from Input_One. 
		if(New_Input_One.front()<New_Input_Two.front()){
			
			Output->push_back(New_Input_One.at(0));
			New_Input_One.erase (New_Input_One.begin());

		}
		//If the First element of Input_One is greater than the First element of Input_Two, we push the front element 
		//	of Input_Two to the back of the output, and then erase that element from Input_Two.
		else if(New_Input_One.front()>New_Input_Two.front()){
			Output->push_back(New_Input_Two.at(0));
			New_Input_Two.erase (New_Input_Two.begin());
		}

		//If the First element of Input_One equals the First element of Input_Two, we push the front element 
		//	of both vectors to the output, before deleting the elements from the Inputs.
		else if(New_Input_One.front()==New_Input_Two.front()){
			Output->push_back(New_Input_One.at(0));
			New_Input_One.erase (New_Input_One.begin());
			Output->push_back(New_Input_Two.at(0));
			New_Input_Two.erase (New_Input_Two.begin());
		}
	}
	
	//If the second input vector is empty, we add all of the elements of the first input to the output.
	while(New_Input_One.size()!=0){
		Output->push_back(New_Input_One.at(0));
		New_Input_One.erase (New_Input_One.begin());
	}

	//If the first input vector is empty, we add all of the elements of the second input to the output.
	while(New_Input_Two.size()!=0){
		Output->push_back(New_Input_Two.at(0));
		New_Input_Two.erase (New_Input_Two.begin());
	}
	
}

void Merge_Sort(vector<int>* input){
	


	vector<int> Output_One={}, Output_Two={};
	//Splits the input into two files Output_One and output 2. 
	Split(*input,&Output_One,&Output_Two);

	/***
	 After splitting the code, we call the recursive Merge Sort function on the output 2 and output 1 functions.
	 Then we merge the two sorted
	 ***/

	if(Output_Two.size()>1){	Merge_Sort(&Output_Two);	}
	if(Output_One.size()>1){	Merge_Sort(&Output_One);	}
	vector<int> sorted={};
	Merge(Output_One, Output_Two, &sorted);
	*input=sorted;

}

